r Ep = data_ep['Ep']\n\n    // vars from callback:\n    var Txx = Txx.value;\n    var Txy = Txy.value;\n    var Tyy = Tyy.value;\n    var Tm = (Txx+Tyy)/2;\n\n    // Set phi = 0, if any spinner is used:\n    var Txx_tmp = data_al['Txx_tmp'];\n    var Txy_tmp = data_al['Txy_tmp'];\n    var Tyy_tmp = data_al['Tyy_tmp'];\n    if ( Txx != Txx_tmp || Txy != Txy_tmp || Tyy != Tyy_tmp ){\n        Txx_tmp[0]=Txx;\n        Txy_tmp[0]=Txy;\n        Tyy_tmp[0]=Tyy;\n        phi.value=0;\n        \n    }\n\n    var phi = phi.value;\n\n    // Multiline cyan:\n    var C = data_ml['C'];\n    var S = data_ml['S'];\n    var X = data_ml['X'];\n    var Y = data_ml['Y'];\n    var XS = data_ml['XS'];\n    var YS = data_ml['YS'];\n\n    // Little Circle black:\n    var x = data_al['x']\n    var y = data_al['y']\n    var xm = data_al['xm']\n    var ym = data_al['ym']\n\n    // label at little circle:\n    var x_lbl = data_lb['x']\n    var y_lbl = data_lb['y']\n\n    // CS green:\n    var EX = data_al['EX']\n    var EY = data_al['EY']\n\n    // CS blue:\n    var ex = data_al['ex']\n    var ey = data_al['ey']\n\n    // Eigen:\n    var evx = data_al['evx']\n    var evy = data_al['evy']\n    var phi1 = data_al['phi1']\n    var phi1deg = data_al['phi1deg']\n    var start = data_al['start']\n    var end = data_al['end']\n    var start_X = data_al['start_X']\n    var end_X = data_al['end_X']\n    var minx = data_al['minx']\n    var maxx = data_al['maxx']\n\n    // AnnularWedge blue:\n    var xa = data_al['xa']\n    var ya = data_al['ya']\n    var pa = data_al['pa']\n    var pad = data_al['pad']\n    var pad2 = data_al['pad2']\n    var px = data_al['px']\n\n    // red:\n    var outer_radius = data_al['outer_radius']\n    var inner_radius = data_al['inner_radius']\n    var start_angle = data_al['start_angle']\n    var end_angle = data_al['end_angle']\n\n\n    if ( phi &gt;= 0.0 ){\n        var start_angle = data_al['start_angle']\n        var end_angle = data_al['end_angle']\n    }\n    else {\n
